INSERT INTO `groups` (`id`, `name`, `description`, `image`, `contract`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Enseñanza', 'La Asociación Departamental de Natación de Quetzaltenango, realiza año con año el curso\r\nVacacional de natación desde 1999 a la fecha. 24 años al servicio de la comunidad Quetzalteca con\r\nla finalidad de presentar alternativas de utilización adecuada para el tiempo libre, de escolares que se encuentran en su periodo de vacaciones', '1696889980.jpeg', NULL, 0, '2023-10-05 14:33:55', '2023-10-11 14:24:52'),
(2, 'Matronatación', 'La matronatación es una actividad acuática en la que se busca la estimulación temprana del bebé y reforzar el vínculo afectivo, Desarrollo psicomotor.', '1696974799.jpeg', NULL, 0, '2023-10-05 14:46:21', '2023-10-11 14:25:20'),
(3, 'Curso de Vacaciones', 'La Asociación Departamental de Natación de Quetzaltenango, realiza año con año el curso vacacional de natación desde 1999 a la fecha, 24 años al servicio de la comunidad Quezalteca con la finalidad de establecer alternativas de utilización adecuada del tiempo libre, para los escolares que se encuentran en su periodo vacacional y de esta manera proponer a los escolares que desarrollen habilidades acuáticas', '1697042931.jpeg', NULL, 1, '2023-10-11 14:48:52', '2023-10-11 18:57:42'),
(4, 'CICLO ANUAL 2024', 'La Asociación Departamental de Natación de Quetzaltenango, dio inicio en la  natación desde 1999 a la fecha, 24 años al servicio de la comunidad Quezalteca con la finalidad de establecer alternativas de utilización adecuada del tiempo libre, para los escolares que se encuentran en su periodo vacacional y de esta manera proponer a los escolares que desarrollen habilidades acuáticas', '1701908769.jpeg', NULL, 1, '2023-12-06 23:26:09', '2023-12-06 23:37:51');
