INSERT INTO `noticias` (`id`, `titulo`, `imagen`, `contenido`, `created_at`, `updated_at`) VALUES
(1, 'Prueba de noticia 1', '1706218772.jpg', '<p><strong>Lorem Ipsum</strong> es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido usó una galería de textos y los mezcló de tal manera que logró hacer un libro de textos especimen. No sólo sobrevivió 500 años, sino que tambien ingresó como texto de relleno en documentos electrónicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creación de las hojas \"Letraset\", las cuales contenian pasajes de Lorem Ipsum, y más recientemente con software de autoedición, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.</p><figure class=\"image\"><img style=\"aspect-ratio:1920/900;\" src=\"http://localhost:8000/media/1685037436_1706218751.jpg\" width=\"1920\" height=\"900\"></figure>', '2024-01-25 21:39:32', '2024-01-25 21:39:32'),
(2, 'Noticia de prueba 2', '1706219157.jpeg', '<p>asd fasd fasddf asdf asd fasdf asdf adsf</p>', '2024-01-25 21:45:57', '2024-01-25 21:45:57');
